export default (state = null, action) => {
    if(action.type === 'ON_MAIN')
        return 'main';
    if(action.type === 'OFF_MAIN')
        return null;
    if(action.type === 'ON_LOCATION_MAP')
        return 'location';
    if(action.type === 'OFF_LOCATION_MAP')
        return null;
    else return state;
}
